import { default as First_page } from '@/components/first_page.vue'
import { default as Create_lobby } from '@/components/create_lobby.vue';

const check_user_mount = (to, from , next) => {
    if( from.count <= 2 && from.count >= 4 ) {
        alert("인원 선택이 잘못되었습니다.");
        return;
    }
    
    next();
}

export const routes = [
    {
        path: '/', 
        redirect: '/alchemists' 
    }, {
        path: '/alchemists',
        component: First_page
    }, {
        name : 'create_lobby',
        path: '/create_lobby/:count',
        component: Create_lobby,
        beforeEnter: check_user_mount(),
    }
]
